// Base64 gambar yang ingin ditampilkan
const base64Image = "data:image/jpeg;base64,";  // Gantilah dengan base64 gambar yang sesuai

// Fungsi untuk menampilkan gambar base64 di elemen gambar
function displayBase64Image(base64Image) {
    const imageElement = document.getElementById("image-detect");
    imageElement.src = base64Image;
}

// Menampilkan gambar base64
displayBase64Image(base64Image);
